import React from "react";
const favoriteSmells = ['gardenias','mint','fire'];

function HelloDiv() {
  return  <div>
            <h1>Hello! My name is Andrew.</h1>
            <ul>{favoriteSmells.map(item => <li>{item}</li>)}</ul>
          </div>;
}

export default HelloDiv;
